import React from 'react';
import "../../CSS/main.css";

export default function Booking({active, setActive, link}) {

    const stopPropagation = () => {
        e.stopPropagation();
        e.nativeEvent.stopImmediatePropagation();
    };

    return (
        <div className={active ? "modal active" : "modal"} onClick={() => setActive(false)}>
            <div className='booking-block flex' onClick={e => stopPropagation}>
                <div className="booking-top flex">
                    <h2 className="booking-title">Записаться на прием</h2>
                    <div className="close-block flex" onClick={() => setActive(false)}>
                        <span className="close-booking"></span>
                    </div>  
                </div>

                <div className="iframe-container">
                    <iframe className='yclient' height="600px" width="320px" frameBorder="0" allowtransparency="true" id="ms_booking_iframe" src={link} scrolling="yes" style={{ overflow: 'auto' }}></iframe>  
                </div>

            </div>
        </div>
  )     
}
